import React, {Component} from 'react';
import {Form,Button} from "react-bootstrap";

class Edycja extends Component {
    render() {
        if(this.props.typ === "doks")
            return (
                <tr>
                    <td><Form.Control as="input" placeholder={this.props.id} name="id" value={this.props.id}  disabled  /></td>
                    <td><Form.Control as="input" placeholder="Enter Id magazynu" name="idMag" /></td>
                    <td><Form.Control as="input" placeholder="Enter typ dokumentu" name="tDok" /></td>
                    <td></td>
                    <td><Form.Control as="input" placeholder="Enter Id Firmy" name="idF"/></td>
                    <td><Form.Control type="datetime-local" placeholder="Enter Data" name="data" /></td>
                    <td><Button variant="outline-info" type="submit" className="dane"> OK </Button></td>
                </tr>

            );
        else if(this.props.typ === "tow")
            return (
                <div>
                    Dodawanie towaru
                </div>
            );
        else if(this.props.typ === "firms")
            return (
                <div>
                    Dodawanie firmy
                </div>
            );
        else if(this.props.typ === "mags")
            return (
                <div>
                    Dodawanie magazynu
                </div>
            );
        else if(this.props.typ === "dok")
            return (
                <div>
                    Dodawanie pozycji
                </div>
            );
    }
}

export default Edycja;
